export default createContext({
    currentFillAngle: 0,
    radius: 0,
    rotation: 0,
    min: 0,
    max: 0,
    angle: 0,
    lineCap: 'butt',
    accentColor: '#00e0ff',
    fontFamily: 'helvetica',
    value: 0,
});
